import React from "react";
const img="img/afsar.jpg"
const Resume =()=>{
    return (
        <>
            <h1>Resume</h1>
                <img src={img} alt="Afsar image" style={{height:"600px",display:"flex"}}></img>
                
        </>
    )
}
export default Resume;
